ient and get their address and let me know.  Interpreter advised he would contact patient and let me know.\'', '\'OTHER LANG CERT\'', '\'014\'', '100', '1', '100', '\'SPA STAND MLG\'', '0', '0', '0', '0', '0', '100', '100', '\'No Show\'', '\'1\'', '\'\''),
